import React from 'react';

const AboutPage = () => {
  // You would retrieve the logged-in user's ID from context, props, or state
  // const userID = 'some unique identifier for the user'; 

  return (
    <section>
      <p>This application generates visual representations of Last.FM data</p>
      <table>
        <tbody>
          <tr>
            <td>License:</td>
            <td><span> GNU Public</span></td>
          </tr>
          <tr>
            <td>Logged In User:</td>
            <td><span id="UserID">{/* userID */}</span></td>
          </tr>
          <tr>
            <td>Author:</td>
            <td><span id="author">J Kang</span></td>
          </tr>
          <tr>
            <td>Contact:</td>
            <td><span id="contact">kangjacob1@gmail.com</span></td>
          </tr>
        </tbody>
      </table>
    </section>
  );
};

export default AboutPage;
